import React, { useEffect, useState } from 'react';
import { Badge, Box, Grid, Heading } from "@chakra-ui/react";
import './App.css';
import axios from 'axios';
import { Map, Marker } from "google-maps-react";
import MapContainer from './MapContainer';
import CardContainer from './CardContainer';


function App() {
  let url = "https://earthquake.usgs.gov/earthquakes/feed/v1.0/summary/significant_month.geojson"
  const [data, setData] = useState([])

  async function fetchEarthquakes() {
    const response = await axios.get(url);
    setData(response.data.features)
    console.log(data);
}



  useEffect(() => {
    fetchEarthquakes()
  }, [])

  return (
    <div className="App">
      <header className="App-header" />
      <div className="Quake-container">
        <Heading as="h2" size="xl" paddingBottom="1em" isTruncated>Earthquakes from the past month </Heading>
        <CardContainer data={data} />
        <Heading as="h2" size="xl" paddingBottom="1em" paddingTop="1.5em" isTruncated>Map of Quakes</Heading>
        <MapContainer data={data} />
      </div>
      <footer className="App-footer">
        <Heading as="h2" size="lg" paddingBottom="1em" paddingTop="1.5em" isTruncated>Â© 2021 ACME Corporation</Heading>
      </footer>
    </div>
  );
}

export default App;
